import React, { useEffect, useState } from 'react';
import "./SearchPage.css";
import { useStateValue } from "../StateProvider";
import useGoogleSearch from '../useGoogleSearch';
import { Link } from "react-router-dom";
import Search from './Search';
import SearchIcon from '@material-ui/icons/Search';
import DescriptionIcon from '@material-ui/icons/Description';
import ImageIcon from '@material-ui/icons/Image';
import LocalOfferIcon from '@material-ui/icons/LocalOffer';
import MoreVertIcon from '@material-ui/icons/MoreVert';
import { storeSearchResults, getStoredSearchResults } from '../indexDB';

function SearchPage() {
  const [{ term }, dispatch] = useStateValue();
  const { data } = useGoogleSearch(term);
  const [storedResults, setStoredResults] = useState([]);

  useEffect(() => {
    if (data?.items) {
      storeSearchResults(data.items);
    }
  }, [data]);

  useEffect(() => {
    getStoredSearchResults().then((results) => {
      setStoredResults(results);
    });
  }, []);

  const myFunction = () => {
    var y = document.getElementById("home1").className;
    if (y.length === 10) {
        document.getElementById("home1").classList.add("dark-mode");
        document.getElementById("home2").classList.add("dark-mode");
        document.getElementById("root").classList.add("dark-mode");
    }
    else {
        document.getElementById("home1").classList.remove("dark-mode");
        document.getElementById("home2").classList.remove("dark-mode");
        document.getElementById("root").classList.remove("dark-mode");
    }
  };


  const searchResults = data?.items || [];

  const searchResultsLeft = data?.items?.slice(0, 5); // Slice first 5 search results for the left side
  const searchResultsRight = data?.items?.slice(5, 10); // Slice next 5 search results for the right side

  return (
    <>
      <div className="searchPage" id="home1">
        <div className="searchPage__header">
          <Link to="/">
            <img src="https://cdn.discordapp.com/attachments/1123095896989642854/1135529041147998359/Screenshot_9.png" alt="" />
          </Link>
        </div>
        <div className="searchPage__Headerbody">
          <Search hideButtons />
          <div className="searchPage__options">
          <SearchIcon />
                <Link to="/all">All</Link>
              </div>
              <div className="searchPage__option">
                <DescriptionIcon />
                <Link to="/news">News</Link>
              </div>
              <div className="searchPage__option">
                <ImageIcon />
                <Link to="/images">Images</Link>
              </div>
              <div className="searchPage__option">
                <LocalOfferIcon />
                <Link to="/maps">Maps</Link>
              </div>
              <div className="searchPage__option">
                <MoreVertIcon />
                <Link to="/more">More</Link>
              </div>
            </div>
            <div className="searchPage__optionsRight">
              <div className="searchPage__option">
                <Link to="/settings">Settings</Link>
              </div>
              <div className="searchPage__option">
                <Link to="/tools">Tools</Link>
              </div>
            </div>
        <button onClick={myFunction}>Toggle dark mode</button>
      </div>
      <div className="searchPage__Body" id="home2">
        {/* Left side search results */}
        <div className="searchPage__resultsLeft">
          {searchResultsLeft?.map((item) => (
            <div className="searchPage__result" key={item.link}>
              <a href={item.link}>
                {item.pagemap?.cse_image?.length > 0 && item.pagemap?.cse_image[0]?.src && (
                  <img className="searchPage__resultImage" src={item.pagemap?.cse_image[0]?.src} alt="" />
                )}
                {item.displayLink}
              </a>
              <a className="searchPage__resultTitle" href={item.link}>
                <h2>{item.title}</h2>
              </a>
              <p className="searchPage__resultSnippet">
                {item.snippet}
              </p>
            </div>
          ))}
        </div>
        {/* Right side search results */}
        <div className="searchPage__resultsRight">
          {searchResultsRight?.map((item) => (
            <div className="searchPage__result" key={item.link}>
              <a href={item.link}>
                {item.pagemap?.cse_image?.length > 0 && item.pagemap?.cse_image[0]?.src && (
                  <img className="searchPage__resultImage" src={item.pagemap?.cse_image[0]?.src} alt="" />
                )}
                {item.displayLink}
              </a>
              <a className="searchPage__resultTitle" href={item.link}>
                <h2>{item.title}</h2>
              </a>
              <p className="searchPage__resultSnippet">
                {item.snippet}
              </p>
            </div>
          ))}
        </div>
      </div>
    </>
  );
}

export default SearchPage;
